import React, { Component }from "react";
import Item from "../Item";
class List extends Component{
  render(){
    const {todolist}=this.props
    return(
      <div>
        <ul>
         {
         todolist.map((todolist)=>{
          return  <Item key={todolist.id} {...todolist} updateTodo={this.props.updateTodo}/>
         })
         }

          </ul>
      </div>
    )
  }
}
export default List ;
